import React, { useEffect, useState } from 'react'; // Asegúrate de importar React, useEffect y useState

function GetStudent({ hola }) {
    const [saveNameVariants, setSaveNameVariants] = useState([]);

    useEffect(() => {
        setSaveNameVariants(prevVariants => [...prevVariants, hola]);
    }, [hola]); // Se ejecuta cada vez que 'hola' cambie

    console.log("Esto es el contenido: " + hola);
    console.log("Todas las variaciones: ", saveNameVariants);

    return (
        <div>
            <p>Variaciones guardadas:</p>
            <ul>
                {saveNameVariants.map((variant, index) => (
                    <li key={index}>{variant}</li>
                ))}
            </ul>
        </div>
    );
}

export default GetStudent;
